<!DOCTYPE html><html lang="en"><head><style>
:root {
    --main-bg-color: #68B8F9;
    --main-font-color: black;
    --main-font-family: Monospace;
    --main-font-size: 15px;
    --secondary-bg-color: #a4d4fb;
    --main-bottom: -20%;
    --main-right: 2%;
    --main-opacity: 1;
    --main-border-radius: 5px;
    --main-box-shadow: rgba(0, 0, 0, 0.35) 0 5px 15px;
    --main-position: fixed;
    --main-width: 500px;
    --main-height: 100px;
    --main-transition-property: top;
    --main-transition-delay: 500ms;
}

html {
    scroll-behavior: smooth;
    scroll-padding-left: 30%;
}

div h3 {
    scroll-margin-top: 60px;
    font-family: var(--main-font-family);
    font-size: clamp(16px, 2vw, 22px);
}

div p {
    font-family: var(--main-font-family);
    font-size: clamp(13px, 1.5vw, 18px);
}

.copyButton {
    padding-right: 5px;
}

.copyQueryTextButton {
    padding: 3px 7px 3px 3px;
}

td p {
    display: flex;
    font-size: clamp(12px, 1.2vw, 18px);
}

td p:nth-of-type(2) {
    display: flex;
    align-items: center;
}

.small_p {
    justify-content: center;
}

p i {
    font-size: clamp(10px, 1vw, 13px);
}

p a {
    text-decoration: none;
    color: #059FF5;
}

td {
    scroll-margin-top: 50px;
}

tr {
    scroll-margin-top: 50px;
}

#container {
    position: absolute;
    overflow: auto;
    padding-left: 10px;
    transition-property: left;
    transition-duration: 500ms;
}

#logo, #logoMini {
    display: block;
    margin-top: 1em;
    margin-bottom: 1.7vh;
}

#logo {
    width: 11vw;
    height: 3vw;
    min-width: 105px;
    min-height: 50px;
}

#logoMini {
    width: 40px;
    height: 40px;
}

#logo.hidden, #logoMini.hidden {
    display: none;
}

#logo:hover, #logoMini:hover {
    cursor: pointer;
}

title {
    display: flex;
    align-items: center;
    cursor: pointer;
}

.arrow {
    cursor: pointer;
    margin-right: 5px;
    transition: transform 0.3s ease;
    display: inline-block;
    width: 1.1vw;
    height: 1.1vw;
    min-width: 11px;
    min-height: 11px;
}

.arrow.up {
    transform: rotate(180deg);
}

#searchField {
    width: 100%;
    appearance: none;
    -webkit-appearance: none;
    -moz-appearance: none;
    border: none;
    outline: none;
    background: none;
    font-family: var(--main-font-family);
    font-size: clamp(10px, 1vw, 13px);
}

#searchButton {
    border: none;
    background: transparent;
    cursor: pointer;
    appearance: none;
    -webkit-appearance: none;
    -moz-appearance: none;
    padding: 8px;
    background-repeat: no-repeat;
    background-position: right 5px center;
    background-size: 16px 16px;
    vertical-align: middle;
}

#searchWrap {
    border-radius: 50px;
    outline: none;
    border: 1px solid #8898AE;
    font-family: var(--main-font-family);
    height: 35px;
	box-sizing: border-box;
	padding: 0 0 0 8px;
	line-height: 35px;
	display: flex;
}

#searchDropdownContainer.hidden {
    display: none;
}

option:first-child {
    font-style: italic;
}

#dropdownSelect {
    width: 100%;
    border-radius: 50px;
    outline: none;
    border: 1px solid #8898AE;
    font-family: var(--main-font-family);
    font-size: clamp(10px, 1vw, 13px);
    height: 35px;
    box-sizing: border-box;
    padding: 0 0 0 9px;
    appearance: none;
    -webkit-appearance: none;
    -moz-appearance: none;
}

#pageContent.hidden {
    min-width: 35px;
}

#pageContent {
    position: fixed;
    z-index: 999;
    background-color: #F4F7FA;
    left: 0;
    top: 0;
    max-width: 19vw;
    height: 100%;
    overflow-y: auto;
    overflow-x: hidden;
    font-size: clamp(12px, 1.1vw, 18px);
    opacity: 1;
    padding-left: 20px;
    padding-right: 20px;
    transition: width 500ms;
    font-family: var(--main-font-family);
}

#pageContent.hidden div.level1 {
    display: none;
}

#pageContent div.level1 {
    font-weight: 600;
    cursor: pointer;
}

#sections {
    padding-top: 2vh;
}

.chapter {
    position: relative;
    display: flex;
    align-items: center;
    justify-content: space-between;
}

.chapter.activeSection {
    border-radius: 6px;
    border: 1px solid #FFC83B;
}

#pageContent div.level2 {
    font-weight: 100;
    padding-left: 1em;
    padding-top: 3px;
}

#pageContent div.level3 {
    padding-left: 1em;
}

#pageContent div.hidden > div {
    display: none;
}

#pageContent a {
    display: block;
    text-decoration: none;
    color: inherit;
    background: none;
    border: none;
    padding: 3px;
}

select {
    margin-top: 8px;
    border: 0;
    appearance: none;
    -webkit-appearance: none;
    -moz-appearance: none;
    padding-right: 20px;
    background: transparent;
    background-repeat: no-repeat;
    background-position: right 5px center;
    background-size: 16px 16px;
    padding: 8px;
}

#commonstat {
    display: flex;
    flex-wrap: wrap;
}

#commonstat div {
    margin-right: 10px;
}

table {
    margin-bottom: 10px;
    font-family: var(--main-font-family);
}

table tr.header {
    color: #FFFFFF;
    font-size: var(--main-font-size);
    font-family: var(--main-font-family);
    background-color: #647d9a;
}

table, th, td {
    border: 1px solid #B5C2D247;
    border-collapse: collapse;
    padding: 4px;
    font-size: clamp(11px, 1.1vw, 18px);
}

table tr td.table_obj_value, table tr td.table_obj_name {
    font-family: var(--main-font-family);
}

table tr td.table_obj_value {
    text-align: right;
}

table tr td.table_obj_name {
    text-align: left;
}

table tr td.fullScreen, td.halfScreen {
    width: 85%;
    font-family: var(--main-font-family);
    font-size: clamp(8px, 0.9vw, 12px);
}

.lineSvg:hover {
    cursor: pointer;
}

.lineSvg line:hover {
    opacity: 1;
}

table tr td.halfScreen {
    width: 42%;
}

table p {
    margin: 0.2em;
}

table tr.new td.switch_bold {
    font-weight: bold;
}

table tr:target, td:target {
    border: medium solid limegreen;
}

table tr:target td:first-of-type, table td:target {
    font-weight: bold;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td {
    background-color: #CCF1FF;
}

table tr.active td:not(.hdr) {
    background-color: #CCF1FF;
}

div.warning {
    display: inline-flex;
    padding: 10px;
    max-width: 300px;
    border-radius: 2px;
    margin-bottom: 10px;
    background-color: #FF827B;
    font-size: 12px;
    color: white;
    font-family: var(--main-font-family);
}

div.notice {
    display: inline-flex;
    padding: 10px;
    max-width: 300px;
    border-radius: 2px;
    margin-bottom: 10px;
    background-color: #CCF1FF;
    font-size: 12px;
    font-family: var(--main-font-family);
}

a svg:hover {
    cursor: pointer;
}

svg:not(#logo, #logoMini) rect:hover, svg circle:hover, svg:not(#logo, #logoMini) path:hover, a.copyButton svg:hover > rect {
    stroke: #059FF5;
    fill: #D9FFCC;
}

/* ----------- Differential report styles ----------- */

td.int1, .int1 td:not(.hdr), table tr.new_i1 {
    background-color: #FFEEEE;
}

td.int2, .int2 td:not(.hdr), table tr.new_i2 {
    background-color: #EEEEFF;
}

table tr.int1:not(.active) td:not(.hdr) {
    background-color: #FFEEEE;
}

table tr.int2:not(.active) td:not(.hdr) {
    background-color: #EEEEFF;
}

table tr.int2 td {
    border-top: hidden;
}

table tr.previewRow {
    background-color: white;
}

table:not(.pgprototals) tr.grey {
    background-color: #eee;
}

table tr.previewRow {
    background-color: white;
}

table tr.previewRow p, table tr.previewRow a, table tr.planRow p, table tr.planRow a {
    display: inline-block;
}

table tr.previewRow p, table tr.planRow p {
    width: 95%;
}

table tr.planRow a {
    float: right;
}

table tr.previewRow a {
    float: left;
}

.queryText, .queryTextId {
    font-size: 13px;
}

table tr.new_i1 td.switch_bold, table tr.new_i2 td.switch_bold, .new td.switch_bold {
    font-weight: bold;
}

.label {
    color: grey;
}

table tr:target, td:target {
    border: medium solid limegreen;
}

table tr:target td:first-of-type, table td:target {
    font-weight: bold;
}

table tr.parent td {
    background-color: #D8E8C2;
}

table tr.child td {
    background-color: #BBDD97;
    border-top-style: hidden;
}

table tr.active td {
    background-color: #CCF1FF;
}

etch, idx_blks_read, idx_blks_hit, relsize, relsize_diff, tablespaceid, indisunique, in_sample, relpages_bytes, relpages_bytes_diff, reloptions ) SELECT sserver_id, s_id, qres.datid, relid, indexrelid, schemaname, relname, indexrelname, dbl.idx_scan AS idx_scan, dbl.last_idx_scan AS last_idx_scan, dbl.idx_tup_read AS idx_tup_read, dbl.idx_tup_fetch AS idx_tup_fetch, dbl.idx_blks_read AS idx_blks_read, dbl.idx_blks_hit AS idx_blks_hit, dbl.relsize AS relsize, dbl.relsize_diff AS relsize_diff, CASE WHEN tablespaceid=$18 THEN qres.tablespaceid ELSE tablespaceid END tablespaceid, indisunique, $19, dbl.relpages_bytes, dbl.relpages_bytes_diff, dbl.reloptions FROM dblink($20, t_query) AS dbl ( relid oid, indexrelid oid, schemaname name, relname name, indexrelname name, idx_scan bigint, last_idx_scan timestamp with time zone, idx_tup_read bigint, idx_tup_fetch bigint, idx_blks_read bigint, idx_blks_hit bigint, relsize bigint, relsize_diff bigint, tablespaceid oid, indisunique bool, relpages_bytes bigint, relpages_bytes_diff bigint, reloptions jsonb )"]}, {"hexqueryid": "4c3273d06c22e896", "query_texts": ["SELECT collect_pg_stat_statements_stats(server_properties, sserver_id, s_id, topn)"]}, {"hexqueryid": "4dd87e7f9cd51b98", "query_texts": ["SELECT oid as tablespaceid,spcname as tablespacename,pg_catalog.pg_tablespace_location(oid) as tablespacepath,pg_catalog.pg_tablespace_size(oid) as size,$1 as size_delta FROM pg_catalog.pg_tablespace", "SELECT oid as tablespaceid, spcname as tablespacename, pg_catalog.pg_tablespace_location(oid) as tablespacepath, pg_catalog.pg_tablespace_size(oid) as size, $1 as size_delta FROM pg_catalog.pg_tablespace"]}, {"hexqueryid": "4f295624bf7d34bf", "query_texts": ["SELECT dblink_connect($9,db_connstr)"]}, {"hexqueryid": "51582704af81013d", "query_texts": ["SET search_path=$1"]}, {"hexqueryid": "53a3325c8fb2c4c2", "query_texts": ["ANALYZE last_stat_tables_srv1"]}, {"hexqueryid": "549d310c18285ea9", "query_texts": ["commit"]}, {"hexqueryid": "54f4c54f2365f7a7", "query_texts": ["SELECT * FROM dummy_func()"]}, {"hexqueryid": "55de7d8c0461769f", "query_texts": ["SELECT t.oid, typarray FROM pg_type t JOIN pg_namespace ns ON typnamespace = ns.oid WHERE typname = $1"]}, {"hexqueryid": "56b14a3a00283994", "query_texts": ["SELECT f.funcid,f.schemaname,f.funcname,pg_get_function_arguments(f.funcid) AS funcargs,f.calls,f.total_time,f.self_time,p.prorettype::regtype::text =$1 AS trg_fn FROM pg_catalog.pg_stat_user_functions f JOIN pg_catalog.pg_proc p ON (f.funcid = p.oid) WHERE pg_get_function_arguments(f.funcid) IS NOT NULL"]}, {"hexqueryid": "5783cba247d2c717", "query_texts": ["SELECT dblink_connect($1,$2)"]}, {"hexqueryid": "595febdf03796bc5", "query_texts": ["UPDATE last_stat_tables ulst SET in_sample = $1 FROM ( SELECT cur.server_id AS server_id, cur.sample_id AS sample_id, cur.datid AS datid, cur.relid AS relid, tcur.relid AS toastrelid, -- Seq. scanned blocks rank row_number() OVER (ORDER BY (cur.seq_scan - COALESCE(lst.seq_scan,$2)) * (cur.relpages_bytes / $3) + (tcur.seq_scan - COALESCE(tlst.seq_scan,$4)) * (tcur.relpages_bytes / $5) DESC) scan_rank, row_number() OVER (ORDER BY cur.n_tup_ins + cur.n_tup_upd + cur.n_tup_del - COALESCE(lst.n_tup_ins + lst.n_tup_upd + lst.n_tup_del, $6) + COALESCE(tcur.n_tup_ins + tcur.n_tup_upd + tcur.n_tup_del, $7) - COALESCE(tlst.n_tup_ins + tlst.n_tup_upd + tlst.n_tup_del, $8) DESC) dml_rank, row_number() OVER (ORDER BY cur.n_tup_upd+cur.n_tup_del - COALESCE(lst.n_tup_upd + lst.n_tup_del, $9) + COALESCE(tcur.n_tup_upd + tcur.n_tup_del, $10) - COALESCE(tlst.n_tup_upd + tlst.n_tup_del, $11) DESC) vacuum_dml_rank, row_number() OVER (ORDER BY cur.n_dead_tup / NULLIF(cur.n_live_tup+cur.n_dead_tup, $12) DESC NULLS LAST) dead_pct_rank, row_number() OVER (ORDER BY cur.n_mod_since_analyze / NULLIF(cur.n_live_tup, $13) DESC NULLS LAST) mod_pct_rank, -- Read rank row_number() OVER (ORDER BY cur.heap_blks_read - COALESCE(lst.heap_blks_read,$14) + cur.idx_blks_read - COALESCE(lst.idx_blks_read,$15) + cur.toast_blks_read - COALESCE(lst.toast_blks_read,$16) + cur.tidx_blks_read - COALESCE(lst.tidx_blks_read,$17) DESC) read_rank, -- Page processing rank row_number() OVER (ORDER BY cur.heap_blks_read+cur.heap_blks_hit+cur.idx_blks_read+cur.idx_blks_hit+ cur.toast_blks_read+cur.toast_blks_hit+cur.tidx_blks_read+cur.tidx_blks_hit- COALESCE(lst.heap_blks_read+lst.heap_blks_hit+lst.idx_blks_read+lst.idx_blks_hit+ lst.toast_blks_read+lst.toast_blks_hit+lst.tidx_blks_read+lst.tidx_blks_hit, $18) DESC) gets_rank, -- Vacuum rank row_number() OVER (ORDER BY cur.vacuum_count - COALESCE(lst.vacuum_count, $19) + cur.autovacuum_count - COALESCE(lst.autovacuum_count, $20) DESC) vacuum_count_rank, row_number() OVER (ORDER BY cur.analyze_count - COALESCE(lst.analyze_count,$21) + cur.autoanalyze_count - COALESCE(lst.autoanalyze_count,$22) DESC) analyze_count_rank, row_number() OVER (ORDER BY cur.total_vacuum_time - COALESCE(lst.total_vacuum_time, $23) + cur.total_autovacuum_time - COALESCE(lst.total_autovacuum_time, $24) DESC) vacuum_time_rank, row_number() OVER (ORDER BY cur.total_analyze_time - COALESCE(lst.total_analyze_time,$25) + cur.total_autoanalyze_time - COALESCE(lst.total_autoanalyze_time,$26) DESC) analyze_time_rank, -- Newpage updates rank (since PG16) CASE WHEN cur.n_tup_newpage_upd IS NOT NULL THEN row_number() OVER (ORDER BY cur.n_tup_newpage_upd - COALESCE(lst.n_tup_newpage_upd, $27) DESC) ELSE $28 END newpage_upd_rank FROM -- main relations diff last_stat_tables cur JOIN last_stat_database dbcur USING (server_id, sample_id, datid) LEFT OUTER JOIN last_stat_database dblst ON (dblst.server_id, dblst.datid, dblst.sample_id) = ($29, dbcur.datid, $30 - $31) AND dblst.stats_reset IS NOT DISTINCT FROM dbcur.stats_reset LEFT OUTER JOIN last_stat_tables lst ON (lst.server_id, lst.sample_id, lst.datid, lst.relid) = ($32, $33 - $34, dblst.datid, cur.relid) -- toast relations diff LEFT OUTER JOIN last_stat_tables tcur ON (tcur.server_id, tcur.sample_id, tcur.datid, tcur.relid) = ($35, $36, dbcur.datid, cur.reltoastrelid) LEFT OUTER JOIN last_stat_tables tlst ON (tlst.server_id, tlst.sample_id, tlst.datid, tlst.relid) = ($37, $38 - $39, dblst.datid, lst.reltoastrelid) WHERE (cur.server_id, cur.sample_id, cur.in_sample) = ($40, $41, $42) AND cur.relkind IN ($43 /*, ... */)) diff WHERE least( scan_rank, dml_rank, dead_pct_rank, mod_pct_rank, vacuum_dml_rank, read_rank, gets_rank, vacuum_count_rank, analyze_count_rank, vacuum_time_rank, analyze_time_rank, newpage_upd_rank ) &lt;= $44 AND (ulst.server_id, ulst.sample_id, ulst.datid, ulst.in_sample) = ($45, $46, diff.datid, $47) AND (ulst.relid = diff.relid OR ulst.relid = diff.toastrelid)"]}, {"hexqueryid": "59683fed0419559d", "query_texts": ["CREATE TEMP TABLE temp_table AS SELECT * FROM pg_statio_all_tables"]}, {"hexqueryid": "5da7549806716339", "query_texts": ["SELECT ss.setting != dblver.version FROM v_sample_settings ss, dblink($5,$6) AS dblver (version text) WHERE ss.server_id = sserver_id AND ss.sample_id = s_id AND ss.name=$7 AND ss.setting_scope = $8"]}, {"hexqueryid": "5db139270be29b3b", "query_texts": ["SELECT f.* FROM flights_v f WHERE f.departure_city = $1 AND f.arrival_city = $2 AND f.scheduled_departure > bookings.now() ORDER BY f.scheduled_departure LIMIT $3"]}, {"hexqueryid": "5fd594024864e3f7", "query_texts": ["UPDATE last_stat_statements ust SET in_sample = $5 FROM (SELECT cur.server_id, cur.sample_id, cur.userid, cur.datid, cur.queryid, cur.toplevel, CASE WHEN cur.total_plan_time - COALESCE(lst.total_plan_time, $6) > $7 THEN row_number() over (ORDER BY cur.total_plan_time + cur.total_exec_time - COALESCE(lst.total_plan_time + lst.total_exec_time, $8) DESC NULLS LAST) ELSE $9 END AS time_rank, CASE WHEN cur.total_plan_time - COALESCE(lst.total_plan_time, $10) > $11 THEN row_number() over (ORDER BY cur.total_plan_time - COALESCE(lst.total_plan_time, $12) DESC NULLS LAST) ELSE $13 END AS plan_time_rank, row_number() over (ORDER BY cur.total_exec_time - COALESCE(lst.total_exec_time, $14) DESC NULLS LAST) AS exec_time_rank, row_number() over (ORDER BY cur.mean_exec_time - COALESCE(lst.mean_exec_time, $15) DESC NULLS LAST) AS mean_exec_time_rank, row_number() over (ORDER BY cur.calls - COALESCE(lst.calls, $16) DESC NULLS LAST) AS calls_rank, CASE WHEN COALESCE(cur.shared_blk_read_time,$17) + COALESCE(cur.shared_blk_write_time,$18) - COALESCE(lst.shared_blk_read_time,$19) - COALESCE(lst.shared_blk_write_time,$20) > $21 THEN row_number() over (ORDER BY cur.shared_blk_read_time + cur.shared_blk_write_time - COALESCE(lst.shared_blk_read_time + lst.shared_blk_write_time, $22) DESC NULLS LAST) ELSE $23 END AS io_time_rank, CASE WHEN COALESCE(cur.temp_blk_read_time, $24) + COALESCE(cur.temp_blk_write_time, $25) - COALESCE(lst.temp_blk_read_time, $26) - COALESCE(lst.temp_blk_write_time, $27) > $28 THEN row_number() over (ORDER BY COALESCE(cur.temp_blk_read_time, $29) + COALESCE(cur.temp_blk_write_time, $30) - COALESCE(lst.temp_blk_read_time, $31) - COALESCE(lst.temp_blk_write_time, $32) DESC NULLS LAST) ELSE $33 END AS io_temp_rank, row_number() over (ORDER BY cur.shared_blks_hit + cur.shared_blks_read - COALESCE(lst.shared_blks_hit + lst.shared_blks_read, $34) DESC NULLS LAST) AS gets_rank, row_number() over (ORDER BY cur.shared_blks_read - COALESCE(lst.shared_blks_read, $35) DESC NULLS LAST) AS read_rank, row_number() over (ORDER BY cur.shared_blks_dirtied - COALESCE(lst.shared_blks_dirtied, $36) DESC NULLS LAST) AS dirtied_rank, row_number() over (ORDER BY cur.shared_blks_written - COALESCE(lst.shared_blks_written, $37) DESC NULLS LAST) AS written_rank, CASE WHEN cur.temp_blks_written + cur.local_blks_written - COALESCE(lst.temp_blks_written + lst.local_blks_written, $38) > $39 THEN row_number() over (ORDER BY cur.temp_blks_written + cur.local_blks_written - COALESCE(lst.temp_blks_written + lst.local_blks_written, $40) DESC NULLS LAST) ELSE $41 END AS tempw_rank, CASE WHEN cur.temp_blks_read + cur.local_blks_read - COALESCE(lst.temp_blks_read + lst.local_blks_read, $42) > $43 THEN row_number() over (ORDER BY cur.temp_blks_read + cur.local_blks_read - COALESCE(lst.temp_blks_read + lst.local_blks_read, $44) DESC NULLS LAST) ELSE $45 END AS tempr_rank, CASE WHEN cur.wal_bytes - COALESCE(lst.wal_bytes, $46) > $47 THEN row_number() over (ORDER BY cur.wal_bytes - COALESCE(lst.wal_bytes, $48) DESC NULLS LAST) ELSE $49 END AS wal_rank, CASE WHEN cur.parallel_workers_to_launch + cur.parallel_workers_launched - COALESCE(lst.parallel_workers_to_launch, $50) - COALESCE(lst.parallel_workers_launched, $51) > $52 THEN row_number() over (ORDER BY cur.parallel_workers_to_launch + cur.parallel_workers_launched - COALESCE(lst.parallel_workers_to_launch, $53) - COALESCE(lst.parallel_workers_launched, $54) DESC NULLS LAST) ELSE $55 END AS wrkrs_rank FROM last_stat_statements cur -- In case of statements in already dropped database JOIN sample_stat_database db USING (server_id, sample_id, datid) LEFT JOIN last_stat_statements lst ON (cur.server_id, lst.server_id, cur.sample_id, lst.sample_id, cur.datid, cur.userid, cur.queryid, cur.toplevel) = (sserver_id, sserver_id, s_id, s_id - $56, lst.datid, lst.userid, lst.queryid, lst.toplevel) AND (cur.stats_since = lst.stats_since OR ( (NOT statements_reset) AND cur.calls >= lst.calls ) ) WHERE (cur.server_id, cur.sample_id) = (sserver_id, s_id) ) diff WHERE ( least( time_rank, plan_time_rank, wal_rank, io_time_rank, exec_time_rank, mean_exec_time_rank, calls_rank, gets_rank, read_rank, dirtied_rank, written_rank, io_temp_rank, tempw_rank, tempr_rank, wrkrs_rank ) &lt;= topn ) AND (ust.server_id ,ust.sample_id, ust.userid, ust.datid, ust.queryid, ust.toplevel, ust.in_sample) = (diff.server_id, diff.sample_id, diff.userid, diff.datid, diff.queryid, diff.toplevel, $57)"]}, {"hexqueryid": "61a5698889949fb1", "query_texts": ["INSERT INTO session_attr AS isa ( server_id, backend_type, datid, datname, usesysid, usename, application_name, client_addr ) SELECT DISTINCT ls.serve class Utilities {
    static sort(data, key, direction) {
        return structuredClone(data.sort((a, b) => {
            if (a[key] < b[key]) {
                return -1 * direction;
            } else if (a[key] > b[key]) {
                return direction;
            } else {
                return 0;
            }
        }))
    }
    static sum(data, key) {
        return data.reduce((partialSum, a) => partialSum + a[key], 0);
    }
    static filter(data, key) {
        if (key.type === "exists") {
            if (data.every(obj => key["field"] in obj)) {
                return structuredClone(data.filter(obj => obj[key["field"]]));
            }
        } else if (key.type === "equal") {
            if (data.every(obj => key["field"] in obj)) {
                return structuredClone(data.filter(obj => obj[key["field"]] === key["value"]));
            }
        }
        return data;
    }
    static find(data, key, value) {
        return structuredClone(data.filter(obj => obj[key] === value));

    static limit(data, num) {

class BaseChart {
    static drawIntoTable(cls, newRow, column, data) {
        let key = column.ordering[0] === '-' ? column.ordering.substring(1) : column.ordering;
        let value = column.id;
        let direction = column.ordering[0] === '-' ? -1 : 1;
        let newCell = newRow.insertCell(-1);
        newCell.setAttribute('class', column.class);
        if (Utilities.sum(data, value) > 0) {
            let orderedData = Utilities.sort(data, key, direction);
            let svg = cls.drawSVG(orderedData, value, key);
            newCell.insertAdjacentHTML('beforeend', svg);
        }
    }
}
class PipeChart extends BaseChart {
    static drawSVG(orderedData, value, key) {
        let x = 0; // Start position of nested svg
        let nestedSvg = '';
        let totalWidth = 0;
        orderedData.forEach(elem => {
            let width = Math.floor(elem[value]);
            if (width > 0) {
                totalWidth += width;
            }
        });
        orderedData.forEach(elem => {
            let width = Math.floor(elem[value]);
            if (width > 0) {
                let textContent = `${elem.objname}: ${elem[key]}`;
                let lineColor;
                if (elem[value] > 50) {         // >50%
                    lineColor = "FA1900";
                } else if (elem[value] > 25) {  // >25% <=50%
                    lineColor = "FF9500";
                } else if (elem[value] > 10) {  // >10% <=25%
                    lineColor = "FFC83B";
                } else {                        // <=10%
                    lineColor = "00B896";
                }
                if (width !== 100) {
                    width = width - 0.3;
                }
                nestedSvg += `
                    <svg class="lineSvg" height="2em" width="${width}%" x="${x}%">
                        <title>${elem.objname}: ${elem[value]}%</title>
                        <line opacity="0.4" x1="0" y1="80%" x2="100%" y2="80%" stroke="#${lineColor}" stroke-width="4px"></line>
                        <text x="0.1em" y="45%" dominant-baseline="middle" fill="#${lineColor}" class="textSvg">
                            ${textContent}
                        </text>
                    </svg>
                `;
                x += width + 0.3;
            }
        });
        if (totalWidth < 100) {
            let remainingWidth = 100 - totalWidth;
            nestedSvg += `
                <svg class="lineSvg" height="2em" width="${remainingWidth}%" x="${x}%">
                    <title>Others (${remainingWidth}%)</title>
                    <line opacity="0.4" x1="0" y1="80%" x2="100%" y2="80%" stroke="#8898AE" stroke-width="4px"></line>
                </svg>
            `;
        }
        return `<svg height="2em" width="100%" class="pipe-chart-container">${nestedSvg}</svg>`;
    }
    static drawIntoTable(newRow, column, data) {
        BaseChart.drawIntoTable(PipeChart, newRow, column, data);
        setTimeout(() => {
            let containerSvg = newRow.querySelectorAll('.pipe-chart-container');
            containerSvg.forEach(containerSvg => {
                if (containerSvg) {
                    PipeChart.checkTextOverflow(containerSvg); 
                    let resizeObserver = new ResizeObserver((entries) => {
                        entries.forEach(entry => {
                            PipeChart.checkTextOverflow(entry.target);
                        });
                    });
                    resizeObserver.observe(containerSvg);
                    containerSvg._resizeObserver = resizeObserver;
                }
            });
        }, 100); 
        return true;
    }
    static checkTextOverflow(containerSvg) {
        let lineSvgs = containerSvg.querySelectorAll('.lineSvg');
        if (lineSvgs) {
            lineSvgs.forEach(svg => {
                let textElement = svg.querySelector('.textSvg');
                let lineElement = svg.querySelector('line');
                if (textElement && lineElement && textElement.getBBox && lineElement.getBBox) {
                    let textBBox = textElement.getBBox();
                    let lineBBox = lineElement.getBBox();
                    textElement.style.visibility = textBBox?.width > lineBBox?.width ? 'hidden' : 'visible';
                }
            });
        }
    }
}

class BaseSection {
    constructor(section, deep) {
        this.section = section;
        this.deep = deep;
        this.sectionHasContent = ('content' in section);
        this.sectionHasTable = ('header' in section);
        this.sectionHasTitle = ('tbl_cap' in section);
    }
    static buildTitle(section, deep) {
        let title = document.createElement('h3');
        if (deep !== 1) {
            title = document.createElement('p');
        }
        title.innerHTML = section.tbl_cap;
        title.id = section.sect_id;
        return title;
    }
    init() {
        let div = document.createElement('div');
        if (this.section.sect_id) {
            div.setAttribute('id', this.section.sect_id);
        }
        if (this.sectionHasTitle) {
            div.appendChild(BaseSection.buildTitle(this.section, this.deep));
        }
        if (this.sectionHasContent) {
            let contentClass = this.section.content.class;
            let contentText = this.section.content.text;
            let contentDiv = document.createElement('div');
            contentDiv.classList.add(contentClass);
            contentDiv.innerHTML = contentText;
            div.appendChild(contentDiv);
        }
        if (this.sectionHasTable) {
            let table = document.createElement('table');
            table.setAttribute('id', `${this.section.sect_id}_t`);
            for (let i = 0; i < this.section.header.length; i++) {
                let newBlock = structuredClone(this.section);
                newBlock.header = this.section.header[i];
                if (newBlock.header.source) {
                    newBlock.data = data.datasets[newBlock.header.source];
                } else {
                    newBlock.data = this.section.data[i];
                }
                if (!newBlock.data) {
                    console.log(newBlock);
                    continue;
                }
                if (newBlock.header.filter) {
                    newBlock.data = Utilities.filter(newBlock.data, newBlock.header.filter);
                }
                if (newBlock.header.ordering) {
                    let direction = 1;
                    let key = newBlock.header.ordering;
                    if (newBlock.header.ordering.startsWith('-')) {
                        direction = -1;
                        key = newBlock.header.ordering.slice(1);
                    }
                    newBlock.data = Utilities.sort(newBlock.data, key, direction);

            } else if (typeof header.id === 'object') {

        if (matrixWithVectors[0]) {

        } else {

        }

    }

        let highlightRowAttrs = this.section.header.highlight;
        let previewQueryAttrs = this.section.header.preview;
        let scrollQueryAttrs = this.section.header.scroll;
        let rows = this.section.data;  // Getting json array with data
        if (highlightRowAttrs) {
            let result = JSON.stringify(highlightRowAttrs);
            this.table.setAttribute('data-highlight', result);
        }
        if (previewQueryAttrs) {
            let result = JSON.stringify(previewQueryAttrs);
            this.table.setAttribute('data-preview', result);
        }
        if (scrollQueryAttrs) {
            let scrollAttrs = JSON.stringify(scrollQueryAttrs);
            this.table.setAttribute('data-scroll', scrollAttrs);

            let row = rows[i];

class VerticalTable extends BaseTable {

            } else {
                columns.push(rows[i]);
            }
        }

    }

        if ('caption' in column) {
            let newText = document.createTextNode(column['caption']);
            newCell.appendChild(newText);
        }
        if ('title' in column) {
            newCell.setAttribute('title', column.title);
        }
        if ('id' in column) {
            newCell.innerHTML = row[0][column.id];
        }
        if (klass) {
            newCell.setAttribute('class', klass);
        }
    }
    insertRows() {
        let columns = VerticalTable.getColumns(this.section);
        let classes = this.section.header.columns;
        let rows = this.section.data;
        for (let i = 0; i < columns.length; i++) {
            let newRow = this.table.insertRow(-1);
            if (i % 2 !== 0) {
                newRow.classList.add('grey');
            }
            VerticalTable.buildCell(newRow, columns[i], rows, classes[0].class);
            for (let j = 0; j < columns[i].cells.length; j++) {
                let cell = columns[i].cells[j];
                let klass = classes[j].class;
                VerticalTable.buildCell(newRow, cell, rows, klass);
            }
        }
    }

        let stillNotRow = target.tagName.toLowerCase() !== targetTag;
        if (tooDeep) {
            return false;
        } else if (headOfTable) {
            return false;
        } else if (stillNotRow) {
            curDeep++;
            return Highlighter.getClosestTag(target.parentNode, curDeep, targetTag);
        } else {

            }

        if (menu) {

                }

        })

        let rowIsSqlList = Highlighter.getClosestTag(row, 0, 'table').id === 'sqllist_t';
        let isSameQuery = targetDataset.hexqueryid !== undefined

        if ((trIsSqlList || rowIsSqlList) && isSameQuery) {

        HIGHLIGHTABLE_ROWS.forEach((elem) => {

                Highlighter.highlight(event, HIGHLIGHTABLE_ROWS);
            });
        })
        ALL_ROWS.forEach((elem) => {
            ['mouseover', 'mouseout'].forEach(eventType => {
                elem.addEventListener(eventType, (event) => {
                    Highlighter.smartHover(eventType, event, this.transition);
                });
            })
        })
    }
}
class Menu {
    static buildNavigator(section, deep) {
        let hasNestedSections = ('sections' in section);
        let hasTocCap = ('toc_cap' in section);
        let navigator = document.getElementById('sections');
        let div = document.createElement('div');
        div.classList.add(`level${deep}`);
        if (hasTocCap) {
            let title = document.createElement('div');
            let a = document.createElement('a');
            a.innerHTML = section.toc_cap;
            a.href = `#${section.sect_id}`;
            a.classList.add('anchor');
            a.setAttribute('id', `menu_${section.sect_id}`);
            title.appendChild(a);
            div.appendChild(title);
            if (!hasNestedSections) {
                navigator.appendChild(div);
            } else {
                let nestedDiv = document.createElement('div');
                nestedDiv.classList.add('nested-sections', 'hidden');
                let hasNestedContent = false;
                section.sections.forEach(nestedSection => {
                    let nestedSectionDiv = Menu.buildNavigator(nestedSection, deep + 1);
                    if (nestedSectionDiv) {
                        nestedDiv.appendChild(nestedSectionDiv);
                        hasNestedContent = true;
                    }
                });
                const arrowHTML = `
                    <svg viewBox="0 0 16 16" width="16" height="16" class="arrow">
                        <path fill-rule="evenodd" clip-rule="evenodd" d="M4.9417 5.5L8 8.54753L11.0583 5.5L12.5 6.93662L8.72085 10.7025C8.32273 11.0992 7.67726 11.0992 7.27915 10.7025L3.5 6.93662L4.9417 5.5Z" fill="#A6B5C7"/>
                    </svg>
                `;
                if (hasNestedContent) {
                    title.insertAdjacentHTML('beforeend', arrowHTML);
                    let arrowSvg = title.querySelector('.arrow');
                    div.appendChild(nestedDiv);
                    navigator.appendChild(div);
                    arrowSvg.addEventListener('click', () => {
                        nestedDiv.classList.toggle('hidden');
                        arrowSvg.classList.toggle('up');
                    });
                } else {
                    navigator.appendChild(div);
                }
            }
            return div;
        }
    }
    static buildPageContent(data, parentNode, deep = 1) {
        let initialDeep = 1;
        data.sections.forEach(section => {
            Menu.buildNavigator(section, initialDeep);
        })
        let allLinks = parentNode.querySelectorAll('div[class^="level"] a');
        allLinks.forEach(link => {
            let parentDiv = link.closest('div');
            if (parentDiv) {
                parentDiv.classList.add('chapter');
            }
        });
        return parentNode;
    }

    static buildMenu() {

    static navigateBorder() {
        function updateHighlight() {
            let width = document.getElementById('pageContent').offsetWidth + 30;
            let height = 0;
            let element = document.elementFromPoint(width, height);
            if (element) {
                let sectId;
                let targetHeader = element.closest('h3, p, table');
                if (targetHeader) {
                    if (targetHeader.tagName === 'H3') {
                        sectId = targetHeader.getAttribute('id');
                    } else if (targetHeader.tagName === 'P') {
                        sectId = targetHeader.getAttribute('id');
                    } else if (targetHeader.tagName === 'TABLE') {
                        sectId = targetHeader.parentNode.firstChild.getAttribute('id');
                    }
                }
                if (sectId) {
                    let targetLink = document.querySelector(`.chapter a[href="#${sectId}"]`);
                    let currentChapter = targetLink?.closest('.chapter');
                    if (targetLink && currentChapter) {
                        document.querySelectorAll('.chapter.activeSection').forEach(ch => ch.classList.remove('activeSection'));
                        function highlightParentSections(chapter) {
                            let parentContainer = chapter.closest('[class^="level"]');
                            while (parentContainer) {
                                let parentChapter = parentContainer.querySelector('.chapter:first-child');
                                let nestedSections = parentContainer.querySelector('.nested-sections');
                                if (parentChapter && nestedSections && nestedSections.classList.contains('hidden')) {
                                    parentChapter.classList.add('activeSection');
                                }
                                parentContainer = parentContainer.parentElement.closest('[class^="level"]');
                            }
                        }
                        highlightParentSections(currentChapter);
                        currentChapter.classList.add('activeSection');
                    }
                }
            }
        }
        document.addEventListener('scroll', updateHighlight);
        let observer = new MutationObserver((mutations) => {
            mutations.forEach(mutation => {
                if (mutation.type === 'attributes' && mutation.attributeName === 'class') {
                    updateHighlight();
                }
            });
        });
        document.querySelectorAll('.nested-sections').forEach(section => {
            observer.observe(section, { attributes: true });
        });
        updateHighlight();
    }
    static toggleMenu() {
        let menu = document.getElementById('pageContent');
        let logo = document.getElementById('logo');
        let logoMini = document.getElementById('logoMini');
        let mainContainer = document.getElementById('container');
        let searchDropdownContainer = document.getElementById('searchDropdownContainer');
        let table = document.querySelectorAll('.pgprototals');
        let paddingHorizontal = 40;
        let minMenuWidthPx = 100;
        let collapsedWidthPx = 35;
        function getExpandedWidthPx() {
            let maxWidthVw = 19;
            let widthFromVw = window.innerWidth * maxWidthVw / 100;
            return Math.max(widthFromVw, minMenuWidthPx + paddingHorizontal);
        }
        function toggleMenuState(shouldExpand) {
            let tableMarginRight = window.innerWidth * 0.03;
            if (shouldExpand) {
                const totalWidth = getExpandedWidthPx();
                menu.style.width = (totalWidth - paddingHorizontal) + 'px';
                mainContainer.style.left = totalWidth + 'px';
                menu.classList.remove('hidden');
                logo.classList.remove('hidden');
                logoMini.classList.add('hidden');
                searchDropdownContainer.classList.remove('hidden');
                table.forEach(table => {
                    table.style.width = `${window.innerWidth - totalWidth - tableMarginRight}px`; 
                });
            } else {
                menu.style.width = collapsedWidthPx + 'px';
                mainContainer.style.left = (collapsedWidthPx + paddingHorizontal) + 'px';
                menu.classList.add('hidden');
                logo.classList.add('hidden');
                logoMini.classList.remove('hidden');
                searchDropdownContainer.classList.add('hidden');
                table.forEach(table => {
                    table.style.width = `${window.innerWidth - (collapsedWidthPx + paddingHorizontal) - tableMarginRight}px`; 
                });
            }
        }
        toggleMenuState(!menu.classList.contains('hidden'));
        [logo, logoMini].forEach(elem =>
            elem.addEventListener('click', function() {
                toggleMenuState(menu.classList.contains('hidden'));
            })
        );
        window.addEventListener('resize', function() {
            if (!menu.classList.contains('hidden')) {
                toggleMenuState(true);
            }
        });
    }
    static init() {
        this.buildMenu();
        this.navigateBorder();
        this.toggleMenu();
    }
}
class Previewer {
    static getParentRows() {
        return document.querySelectorAll("table.preview tr:not(.header)");
    }
    static queryTextPreviewer(queryCell, queryRow, newRow, queryString) {
        queryCell.style.width = `${Math.floor(newRow.offsetWidth * 0.95)}px`;
        queryCell.style.fontFamily = 'Monospace';
        queryRow.style.display = '';
        if (!queryCell.hasChildNodes()) {
            let preprocessedText = Utilities.preprocessQueryString(queryString);
            queryCell.insertAdjacentHTML('afterbegin', `<p><i>${preprocessedText}</i></p>`);
        }
    }
    static storageParamsPreviewer(previewCell, previewRow, newRow, previewData) {
        previewCell.style.width = `${Math.floor(newRow.offsetWidth * 0.95)}px`;
        previewCell.style.fontFamily = 'Monospace';
        previewRow.style.display = '';
        if (!previewCell.hasChildNodes()) {
            let topn = data.properties.topn || 20;
            previewData.slice(-topn).reverse().forEach(item => {
                let preprocessedText = Utilities.preprocessQueryString(`${item['first_seen']}: ${item['reloptions']}`);
                previewCell.insertAdjacentHTML('afterbegin', `<p><i>${preprocessedText}</i></p>`);
            })
        }
    }
    static findQuery(queryRaw) {
        // datasetName, dataID, parentRow.dataset[dataID]
        let datasetName = queryRaw.dataset["dataset_name"];
        let dataID = queryRaw.dataset["dataset_col_id"];
        let querySet = data.datasets[datasetName];
        let queryId = queryRaw.dataset["dataset_id"]
        for (let i = 0; i < querySet.length; i++) {
            if (querySet[i][dataID] === queryId) {
                return i
            }
        }
        return -1
    }
    static drawCopyButton() {
        let button = document.createElement('a');
        button.setAttribute('class', 'copyButton');
        button.setAttribute('title', 'Copy to clipboard');
        let svg = `
            <svg width="14" height="14" viewBox="0 0 18 18" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path fill-rule="evenodd" clip-rule="evenodd" d="M8 0C5.79086 0 4 1.79086 4 4V10C4 12.2091 5.79086 14 8 14H14C16.2091 14 18 12.2091 18 10V4C18 1.79086 16.2091 0 14 0H8ZM6 4C6 2.89543 6.89543 2 8 2H14C15.1046 2 16 2.89543 16 4V10C16 11.1046 15.1046 12 14 12H8C6.89543 12 6 11.1046 6 10V4ZM0 7C0 5.69378 0.834808 4.58254 2 4.17071V14C2 15.1046 2.89543 16 4 16H13.8293C13.4175 17.1652 12.3062 18 11 18H3C1.34315 18 0 16.6569 0 15V7Z" fill="#14B0FF"/>
            </svg>
        `
        button.insertAdjacentHTML('afterbegin', svg);
        return button;
    }
    static init() {
        const PARENT_ROWS = Previewer.getParentRows();
        PARENT_ROWS.forEach(parentRow => {
            let previewCell = document.createElement("td");
            previewCell.setAttribute("colspan", "100");
            let previewRow = document.createElement("tr");
            previewRow.classList.add("previewRow");
            let preview = JSON.parse(parentRow.closest('table').dataset["preview"])[0]
            let sourceDatasetName = preview.dataset;
            let sourceDatasetKey = preview.id;
            previewRow.setAttribute("data-dataset_name", sourceDatasetName);
            previewRow.setAttribute("data-dataset_col_id", sourceDatasetKey);
            previewRow.setAttribute("data-dataset_id", parentRow.dataset[sourceDatasetKey]);
            previewRow.style.display = "none";
            previewRow.appendChild(previewCell);
            if (!parentRow.classList.contains("int1")) {
                parentRow.insertAdjacentElement("afterend", previewRow);
            }
            parentRow.addEventListener("click", event => {
                if (parentRow.classList.contains('int1')) {
                    previewRow = parentRow.nextSibling.nextSibling;
                    previewCell = previewRow.firstChild;
                }
                if (
                    event.target.tagName.toLowerCase() !== 'a' &&
                    event.target.tagName.toLowerCase() !== 'rect' &&
                    event.target.tagName.toLowerCase() !== 'svg' &&
                    event.target.tagName.toLowerCase() !== 'path'
                ) {
                    if (previewRow.style.display === 'none') {
                        if (sourceDatasetName === "queries" || sourceDatasetName === "act_queries") {
                            let queryIndex = Previewer.findQuery(previewRow);
                            if (queryIndex >= 0) {
                                let queryText = data.datasets[sourceDatasetName][queryIndex].query_texts[0];
                                Previewer.queryTextPreviewer(previewCell, previewRow, parentRow, queryText);
                                if (!previewCell.querySelector('.copyQueryTextButton')) {
                                    let copyQueryTextButton = Previewer.drawCopyButton();
                                    copyQueryTextButton.setAttribute("class", "copyQueryTextButton");
                                    previewCell.appendChild(copyQueryTextButton);
                                    copyQueryTextButton.addEventListener("click", event => {
                                        navigator.clipboard.writeText(queryText).then(r => console.log(queryText));
                                    });
                                }
                            }
                        }
                        if (sourceDatasetName === "table_storage_parameters" || sourceDatasetName === "index_storage_parameters") {
                            let sourceDataset = data.datasets[sourceDatasetName]; 
                            let targetDatasetValue = parentRow.dataset[sourceDatasetKey];
                            let previewData = Utilities.find(sourceDataset, sourceDatasetKey, targetDatasetValue);
                            if (previewData.length) {
                                let previewDataJSON = JSON.stringify(previewData);
                                Previewer.storageParamsPreviewer(previewCell, previewRow, parentRow, previewData);
                            }
                        }
                    } else {
                        previewRow.style.display = 'none';
                    }
                }
            })
        })
    }
}
function buildReport(data, parentNode, deep) {
    data.sections.forEach(section => {
        let sectionHasNestedSections = ('sections' in section);
        let newSection = new BaseSection(section, deep).init();
        if (sectionHasNestedSections) {
            deep++;
            buildReport(section, newSection, deep);
            deep--;
        }
        parentNode.appendChild(newSection);
    })
    return parentNode;
}
function addDescription(data, parentNode) {
    if (data.properties.description) {
        let description = `
            <h3>Description:</h3>
            <p>${data.properties.description}</p>
        `;
        parentNode.insertAdjacentHTML('beforeend', description);
    }
    if (data.properties.server_description) {
        let server_description = `
            <h3>Server description:</h3>
            <p>${data.properties.server_description}</p>
        `;
        parentNode.insertAdjacentHTML('beforeend', server_description);
    }
}
function main() {
    const CONTAINER = document.getElementById('container');
    addDescription(data, CONTAINER);
    buildReport(data, CONTAINER, 1);
    Highlighter.init();
    Previewer.init();
    Menu.init();
}
main();
